import Vue from "vue";
import App from "./App.vue";
import "bootstrap/dist/css/bootstrap.min.css"; //importo bootstrap
import "jquery";
import "popper.js";
import "bootstrap";
// import "./form";

Vue.config.productionTip = false;

new Vue({
  render: (h) => h(App),
}).$mount("#app");
